import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Header from './Header';

const PropertyManagementPage = () => {
  const [formData, setFormData] = useState({
    user_id: '',
    image_url: '',
    title: '',
    description: '',
    address: '',
    city: '',
    state: '',
    zip_code: '',
    price: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault(); // Prevent the default form submission
    const addUserToFormData = { ...formData, user_id: localStorage.id };
    fetch('http://127.0.0.1:5000/listings', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(addUserToFormData),
    });
  };

  return (
    <div className="min-h-screen flex items-center justify-center">
      <div className="max-w-md w-full">
        <Header />
        <h2 className="text-2xl font-semibold">Property Management</h2>
        <form onSubmit={handleSubmit} className="space-y-4">
          {/* ... form elements ... */}
          <div className="space-x-4">
            <button
              type="submit"
              className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
            >
              Submit Listing
            </button>
            <Link to="/listings-Page">
              <button className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600">
                View Listings
              </button>
            </Link>
            <Link to="/dashboard">
              <button className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">
                Dashboard
              </button>
            </Link>
          </div>
        </form>
      </div>
    </div>
  );
};

export default PropertyManagementPage;
